import ReactDOM from 'react-dom';
import App from './components/App/App';
import Dashboard from './components/Dashboard/Dashboard';

ReactDOM.render(
  <React.StrictMode>
    <App />,
    <Dashboard />
  </React.StrictMode>,
  document.getElementById('root')
);
